import React from "react";
import "./Location.css";

class Location extends React.Component {
  render() {
    return (
      <div className="location">
        <h2 className="title">Location</h2>
        <img className="location_image" src="/images/tenimento1.jpg" />
        <p className="description">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras vitae
          fringilla sem. Aenean vitae purus enim. Quisque sed massa sapien.
          Praesent eget dapibus arcu. Aenean quis gravida risus. Sed molestie
          magna massa, nec auctor odio porta vitae. In hac habitasse platea
          dictumst. Sed semper id lacus eu elementum. Class aptent taciti
          sociosqu ad litora torquent per conubia nostra, per inceptos
          himenaeos.
        </p>
      </div>
    );
  }
}

export default Location;
